import React from "react";
import Instagram from "../images/instagram-brands.svg";
import Facebook from "../images/facebook-square-brands.svg"
const Footer = () => {
  return (
    <div className="footer">
      <div className="footer-p">
        <p>Natascha Henriksen</p>
        <p>
          Email <br /> nataschavejenhenriksen@gmail.com
        </p>
        <img  className="logo" src={Instagram}/>
        <img className="logo" src={Facebook} />
        <p>
          {" "}
          Facebook <br />
          QuietlyThriving
        </p>
      </div>
    </div>
  );
};

export default Footer;
